a.menu-toggle.waves-effect.waves-block:after {
    content: '';
    position: absolute;
    top: 50% !important;
    left: -6px;
    background: var(--primary);
    width: 0px;
    height: 0%;
    border-radius: 1em;
    /* height: 23px; */
    transform: translateY(-50%) !important;
}

a.menu-toggle.toggled.waves-effect.waves-block:after

    /*, a.toggled.waves-effect.waves-block:after */
{
    content: '';
    position: absolute;
    top: 0 !important;
    left: -6px;
    background: var(--primary);
    width: 12px;
    height: 100%;
    border-radius: 1em;
    transform: translateY(0%) !important;

    /* height: 23px;*/
}

