    overflow-wrap: break-word;
    word-break: break-word;
}

.help-block {
    /* padding-top: 1em; */
    color: #b83f3f !important;
}

.has-error .form-control:focus {
    border-color: #b83f3f !important;
    outline: 0 !important;
    -webkit-box-shadow: inset 0 1px 1px rgb(0 0 0 / 8%), 0 0 8px rgba(233, 102, 102, 0.6) !important;
    box-shadow: inset 0 1px 1px rgb(0 0 0 / 8%), 0 0 8px rgba(233, 102, 102, 0.6) !important;
}

.errorIco {
    width: 1.125rem;
    height: 1.125rem;
    color: rgb(169, 37, 43);
    flex: 0 0 auto;
}

.typeChecks svg {
    width: 1.25rem;
    height: 1.25rem;
    color: inherit;
    margin-right: 0.25rem;
    display: inline-block !important;
}

.typeChecks input[type="checkbox"] {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    opacity: 0;
    pointer-events: all;
}

.checkBoxesForm {
    display: inline-block !important;
    border-radius: 3em;
    border: 1px solid;
    display: flex;
    justify-content: center;
    height: 2.5em;
    align-items: center;
}

.checkBoxesForm.checkedBoxesForm {
    background-color: #1c1f25;
    border: 1px solid;
    height: 2.55em;
    color: white;
}

.checkBoxesForm.checkedBoxesForm label {
    color: white;
}

svg[aria-hidden=true] {
    display: none !important;
}

